$(document).ready(function () {
    let sideNavElem = $('.search_sideNav');
    let searhPin = $('#search_pin');
    let searchSeria = $('#search_seria');
    let searchName = $('#search_name');
    let searchSurname = $('#search_surname');
    let searchPatr = $('#search_patr');
    let photo = $('#memberPhoto');
    let name = $('#first_name');
    let surName = $('#last_name');
    let fatherName = $('#father_name');
    let passportNumber = $('#passport_number');
    let birthAddress = $('#birth_address');
    let modaForData = document.getElementById('modalForData');
    let birthDate = $('#birth_date');
    let registrationAddress = $('#registration_address');
    let givenOrganisation = $('#given_organisation');
    let maritalStatus = $('#marital_status');
    let bloodType = $('#blood_type');
    let height = $('#height');
    let eyeColor = $('#eye_color');
    let givenDate = $('#given_date');
    let expireDate = $('#expire_date');
    let pin = $('#pin');
    let activationDate = $('#activation_date');
    let deactivationReason = $('#deactivation_reason');
    let male = $('#male');
    let female = $('#female');
    let idCardSearchBtn = document.getElementById('idCardSearchBtn');
    let cardreaderBtn = document.getElementById('cardreader');




    if (sideNavElem[0]) {
        var sideNavInstance = M.Sidenav.getInstance(sideNavElem[0]);
    }
    if (modaForData) {
        var modalForDataInstance = M.Modal.getInstance(modaForData);
    }


    if (cardreaderBtn) {
        cardreaderBtn.addEventListener('click', getDataFromReader);
    }


    function getDataFromReader() {
        let strUrl = "data:image/jpeg;base64,"

        console.log(strUrl);


        $.post('https://10.36.9.100:8084/fin-al', strUrl, function (dataFromMrzReader) {
            console.log(dataFromMrzReader);
            let strrr = JSON.stringify(dataFromMrzReader);
            
            console.log(strrr);

            return;

            if (dataFromMrzReader?.number) {

                videoDisplayStatus('none');

                formLoaderDisplayStatus('block');

                let number = dataFromMrzReader.number;

                getDataViaSeria(number)
                    .then(dataFromSeriaService => {
                        let result = addPersonData(dataFromSeriaService, true);
                        if (result) {
                            formPreloader[0].classList.add('d-none');
                            return;
                        } else {
                            if (dataFromMrzReader.fin) {
                                let pin = dataFromMrzReader.fin;
                                getDataViaPin(pin)
                                    .then(dataFromPinService => {
                                        let result = addPersonData(dataFromPinService, true);
                                        if (result) {
                                            formLoaderDisplayStatus('none');
                                            return;
                                        } else {

                                            /*captureAndSendPicutre();*/
                                            alert('Vəsiqə məlumatları tapılmadı!');
                                            readMrz();
                                            setTimeout(function () {
                                                captureAndSendPicutre();
                                            }, 1500);
                                        }
                                    })
                            }
                        }
                    })
            } else {
                captureAndSendPicutre();
            }
        }).fail(function (err) {
            let strErr = JSON.stringify(err);
            console.log(strErr);
            alert(strErr);
            return;
        }).done(function () {
            //formPreloader[0].classList.add('d-none');
        })
    }


    if (idCardSearchBtn) {
        idCardSearchBtn.addEventListener('click', function () {
            if (searhPin.val()) {
                getDataFromService(searhPin.val()).then(data => {
                    writeDataToForm(data)
                });
            } else if (searchSeria.val()) {
                getDataFromService(searchSeria.val()).then(data => {
                    writeDataToForm(data)
                });
            } else if (searchName.val() && searchSurname.val()) {
                getDataFromService({ name: searchName.val(), surname: searchSurname.val(), patronymic: searchPatr.val() }, true).then(data => {
                    let comingData = data?.dataForNSP?.getIdCardByASAVm;
                    console.log("comingData",comingData);
                    if (comingData) {
                        if (comingData.length > 1) {
                            writeDataToAsaModal(comingData);
                        } else {
                            let documentNumber = comingData[0].document.number;
                            getDataFromService(documentNumber).then(data => {
                                writeDataToForm(data);
                            })
                        }
                    } else {
                        alert('Məlumat tapılmadı.Zəhmət olmasa məlumatın düzgünlüyünü yoxlayın!');
                        return;
                    }
                });
            } else {
                alert("Məlumat düzgün daxil edilməyib!");
            } 
        } )
    }

    if (modaForData) {
        $('#modalForData').on('click', '.addFormBtn', async function (e) {
            await writeDataFromModalToForm($(this));
        })
    }

    

    function writeDataToAsaModal(data) {
        modalForDataInstance.open();
        let html = "";
        if (data.length) {
            console.log('isnideModalData', data)
            data.forEach((person, index)  => {
                console.log('erson', person)
                html += `
                <tr>
                    <td>${ index + 1 }</td>
                    <td><img src="/static/img/demo_user.webp" width="60" /></td>
                    <td>${person.person.nameAz}</td>
                    <td>${person.person.surnameAz}</td>
                    <td>${person.person.patronymicAz}</td>
                    <td>${person.person.birthDate}</td>
                    <td><a class="waves-effect waves-light btn addFormBtn" data-number="${person.document.number}" ><i class='material-icons left'>group_add</i></a></td>
                </tr>
            `;
            });

            $('#modalDataTable tbody').html(html);
        }
    }

    async function writeDataFromModalToForm(elem) {
        let docNumber = elem.data("number");
        console.log(docNumber);


        if (docNumber) {
            await getDataFromService(docNumber).then(data => {
                if (data == "Err") {
                    alert("Şəxs haqqında ətraflı məlumat yoxdur! Zəhmət olmasa şəxsin vəsiqəsinin aktiv olduğunu dəqiqləşdirin!")
                    return;
                }

                writeDataToForm(data);
            })
        } else {
            alert('Şəxs haqqında ətraflı məlumat yoxdur!');
            return;
        }
    }

    function writeDataToForm(data) {

        //console.log(data);
        if (!data?.data?.data?.document?.number) {
            alert("Melumat tapilmadi!");
            return false;
        }

        let document = data.data.data.document;
        let person = data.data.data.person;

        $('label').addClass('active');
        sideNavInstance.close();
        modalForDataInstance.close();
        console.log(person)

        photo[0].src = (person.images[0].image && person.images[0].image != "data:image/jpeg;base64,") ? person.images[0].image : "/static/img/demo_user.webp";
        name.val(person.nameAz);
        surName.val(person.surnameAz);
        fatherName.val(person.patronymicAz);
        passportNumber.val(document.number);
        birthAddress.val(person.birthAddress.city);
        birthDate.val(person.birthDate);
        registrationAddress.val(person.iamasAddress.fullAddress);
        givenOrganisation.val(document.givenOrganization);
        maritalStatus.val(person.maritalStatus.description);
        bloodType.val(person.bloodType.description);
        height.val(person.height);
        eyeColor.val(person.eyeColor.description);
        givenDate.val(document.givenDate);
        expireDate.val(document.expireDate);
        pin.val(person.pin);
        activationDate.val(document.activationDate);
        deactivationReason.val(document.deactivationReason);
        person.gender.label == "MALE" ? male[0].checked = true : female[0].checked = true;

        searchSeria.val("");
        searhPin.val("");
        searchName.val("");
        searchSurname.val("");
        searchPatr.val("");
        $('#modalDataTable tbody').html("");
    }


    function getDataFromService(info, fromPatr) {
        console.log(info, fromPatr)
        //let endpoint = ""

        //if (info.length < 7 && info.length > 8) {
        //    alert('Məlumat düzgün daxil edilməyib');
        //    return
        //}

        let endpoint = "/Home/IdCardByPin?pin";

        if (fromPatr) {
            endpoint = `/Home/IdCardByNSP?name=${info.name}&surname=${info.surname}&patronymic=${info.patronymic}`;
        }

        console.log(endpoint)

        //if (info.length > 7) {
        //    endpoint = "docnumber?DocumentNumber=";
        //} else {
        //    endpoint = "pin?Pin=";
        //}

        return new Promise((resolve, reject) => {
            fetch(`${endpoint}${!fromPatr ? `=${info}` : ""}`)
                .then(res => res.json())
                .then(data => resolve(data))
                .catch(err => reject(err));
        });
    }











});